    false,nt"url": null,nt"notes": "Few estimates of Chinook egg-to-fry survival
    exist despite the fact that this is thought to be one of the life stages limiting
    production of many listed Chinook populations. The objective of this project is
    to estimate egg-to-fry survival for Chinook salmon at a variety of habitat conditions
    throughout the Yakima & Wenatchee basins. Egg-to-fry survival is estimated in more
    than 100 artificial redds in nine reaches in the Yakima and three in the Wenatchee
    River.nnEgg to fry survival estimates.",nt"license_title": null,nt"extras":
